import React, { Profiler } from 'react';
import './App.css';
import Project from './Components/Project'


const flutter = [
  "https://www.thesprucepets.com/thmb/LPnj-N-AcGdZRvf7E6y_Hsf2vqo=/4089x2300/smart/filters:no_upscale()/close-up-of-a-hamster-eating-groundnut-635096689-5c525f88c9e77c0001d7c1fa.jpg"
];

const mario = [
  "https://github.com/4yerik/images/blob/master/projects/mario-start.jpg?raw=true",
  "https://github.com/4yerik/images/blob/master/projects/mario_level_one.JPG?raw=true",
  "https://github.com/4yerik/images/blob/master/projects/mario_level_two.JPG?raw=true",
  "https://github.com/4yerik/images/blob/master/projects/mario_mushrooms.JPG?raw=true",
  "https://github.com/4yerik/images/blob/master/projects/mario_castle.JPG?raw=true",
  "https://github.com/4yerik/images/blob/master/projects/mario_running.JPG?raw=true",
];

const Projects = () => (
  <React.Fragment>

    <div className="grid matte-green-4">
    </div>

    <div className="grid">
      <div className="left-half navy"></div>
      <div className="right-half jolly"></div>
    </div>

    <Project
      images={flutter}
    >
    </Project>

    <div className="grid">
      <div className="left-half navy"></div>
      <div className="right-half blue"></div>
    </div>

    <Project
      images={mario}
    >
    </Project>
  </React.Fragment>
);

export default Projects;
